import { useState, useEffect } from "react";
import './App.css';
import { MainContainer } from './component/MainContainer';
import { useDispatch, useSelector } from 'react-redux';
import axios from "axios";
import { initialiseUserInfo } from "./features/user/userSlice";


function App() {
  const dispatch = useDispatch();
  const {userInfo} = useSelector((store) => store.js);
  useEffect(() => {
    axios
      .get("http://localhost:5000")
      .then((res) => {
        const userInfo = res.data.data.map(({name, imageName, _id:id }) => ({name, imageName, id}))
        dispatch(initialiseUserInfo(userInfo));
      })
      .catch((err) => console.log(err, "it has an error"));
  },[userInfo]);


  return (
    <>
      <MainContainer/>
    </>
  );
}

export default App;
